import React from 'react';
import ReactDOM from 'react-dom';
import Draggable from 'react-draggable';

function Selection(){

  return(

    <div id="selections" style={{position: 'relative', padding: '0'}}>
      <button>Spawn</button> 
      <button>Also Spawn </button>
    </div>
  );
}

export default Selection;
